import { useEffect, useRef } from 'react'
import { useStore } from '../../store/store'

const OCEAN_B64 = ""

function drawSky(canvas: HTMLCanvasElement) {
  const ctx = canvas.getContext('2d')!
  const w = canvas.width, h = canvas.height
  ctx.clearRect(0, 0, w, h)

  const grad = ctx.createLinearGradient(0, 0, 0, h)
  grad.addColorStop(0.00, '#1e4e9e')
  grad.addColorStop(0.22, '#2e64b4')
  grad.addColorStop(0.48, '#4a82cc')
  grad.addColorStop(0.72, '#7aaee0')
  grad.addColorStop(0.88, '#aacce8')
  grad.addColorStop(1.00, '#c8e0f2')
  ctx.fillStyle = grad
  ctx.fillRect(0, 0, w, h)

  const hazeGrad = ctx.createLinearGradient(0, h * 0.65, 0, h)
  hazeGrad.addColorStop(0.0, 'rgba(192,224,244,0)')
  hazeGrad.addColorStop(0.6, 'rgba(210,232,248,0.28)')
  hazeGrad.addColorStop(1.0, 'rgba(220,238,252,0.50)')
  ctx.fillStyle = hazeGrad
  ctx.fillRect(0, 0, w, h)

  function hash(x: number, y: number) {
    const n = Math.sin(x * 127.1 + y * 311.7) * 43758.5453
    return n - Math.floor(n)
  }
  function smoothNoise(x: number, y: number) {
    const ix = Math.floor(x), iy = Math.floor(y)
    const fx = x - ix, fy = y - iy
    const ux = fx * fx * (3 - 2 * fx)
    const uy = fy * fy * (3 - 2 * fy)
    const a = hash(ix, iy), b = hash(ix+1, iy)
    const c = hash(ix, iy+1), d = hash(ix+1, iy+1)
    return a + (b-a)*ux + (c-a)*uy + (a-b-c+d)*ux*uy
  }
  function fbm(x: number, y: number) {
    let v = 0, amp = 0.5
    for (let i = 0; i < 5; i++) { v += amp * smoothNoise(x, y); x *= 2.1; y *= 2.1; amp *= 0.5 }
    return v
  }

  const imgData = ctx.getImageData(0, 0, w, h)
  const pixels = imgData.data
  for (let x = 0; x < w; x += 2) {
    for (let y = 0; y < Math.round(h * 0.78); y += 2) {
      const n = fbm((x/w)*5.5, (y/h)*2.2*0.6)
      const hf = Math.pow(1.0 - y/(h*0.78), 2)
      const cloud = Math.max(0, (n - 0.52) * 3.5) * hf
      if (cloud > 0.01) {
        for (let dx = 0; dx <= 1; dx++) {
          for (let dy = 0; dy <= 1; dy++) {
            const idx = ((y+dy)*w + (x+dx))*4
            if (idx < pixels.length - 3) {
              pixels[idx]   = Math.min(255, pixels[idx]   + cloud*38)
              pixels[idx+1] = Math.min(255, pixels[idx+1] + cloud*42)
              pixels[idx+2] = Math.min(255, pixels[idx+2] + cloud*48)
            }
          }
        }
      }
    }
  }
  ctx.putImageData(imgData, 0, 0)
}

function drawBlend(canvas: HTMLCanvasElement) {
  const ctx = canvas.getContext('2d')!
  const w = canvas.width, h = canvas.height
  ctx.clearRect(0, 0, w, h)
  const grad = ctx.createLinearGradient(0, 0, 0, h)
  grad.addColorStop(0.00, 'rgba(200,224,244,0)')
  grad.addColorStop(0.30, 'rgba(192,218,240,0.55)')
  grad.addColorStop(0.48, 'rgba(186,214,238,0.82)')
  grad.addColorStop(0.62, 'rgba(180,210,235,0.55)')
  grad.addColorStop(1.00, 'rgba(168,204,230,0)')
  ctx.fillStyle = grad
  ctx.fillRect(0, 0, w, h)
  const line = ctx.createLinearGradient(0, h*0.44, 0, h*0.56)
  line.addColorStop(0,   'rgba(240,248,255,0)')
  line.addColorStop(0.5, 'rgba(240,248,255,0.45)')
  line.addColorStop(1,   'rgba(240,248,255,0)')
  ctx.fillStyle = line
  ctx.fillRect(0, h*0.44, w, h*0.12)
}

export function OceanBase() {
  const skyRef   = useRef<HTMLCanvasElement>(null)
  const blendRef = useRef<HTMLCanvasElement>(null)
  const setLoaded = useStore((s) => s.setLoaded)

  useEffect(() => {
    function resize() {
      const sky = skyRef.current
      const blend = blendRef.current
      if (!sky || !blend) return
      sky.width  = window.innerWidth
      sky.height = Math.round(window.innerHeight * 0.52)
      blend.width  = window.innerWidth
      blend.height = 80
      drawSky(sky)
      drawBlend(blend)
    }
    resize()
    window.addEventListener('resize', resize)
    setTimeout(() => setLoaded(true), 600)
    return () => window.removeEventListener('resize', resize)
  }, [setLoaded])

  return (
    <>
      <div style={{
        position:'absolute', bottom:0, left:0, right:0, height:'52%',
        backgroundImage:`url("data:image/jpeg;base64,${OCEAN_B64}")`,
        backgroundSize:'cover', backgroundPosition:'center center', zIndex:1,
      }}/>
      <canvas ref={skyRef} style={{
        position:'absolute', top:0, left:0, width:'100%', height:'52%', zIndex:2,
      }}/>
      <canvas ref={blendRef} style={{
        position:'absolute', left:0, width:'100%', height:80,
        top:'calc(52% - 40px)', zIndex:3, pointerEvents:'none',
      }}/>
    </>
  )
}
